INSERT INTO `store` VALUES (1,1,'test','/profile/upload/2024/05/12/FOX_0_20240512200229A001.png','梅园食堂一楼 7-11（日语：セブン－イレブン）便利店（商标中的表记方式为：7-ELEVEn）7-Eleven品牌原属美国南方公司，2005年成为日本公司。\n\nSeven&I Holdings公司是Seven-Eleven Japan公司、Ito－Yokado公司、Denny’s Japan公司在2005年9月合并成立的新公司。1927年在美国德克萨斯州创立，7-Eleven的名称则源于1946年，藉以标榜营业时间由上午7时至晚上11时，后由日本零售业经营者伊藤洋华堂于1974年引入日本，从1975年开始变更为24小时全天候营业。'),(2,2,'test2','/profile/upload/2024/05/12/iKUN_5_20240512231553A001.png','梅园超市隔壁 KUNKUN'),(3,1,'天猫超市',NULL,'猫超 天猫超市(Tmall Mart)是淘天集团旗下的线上超市\n天猫超市诞生于2011年4月，品牌slogan“送货上门还挺快”。\n作为淘天集团旗下 [9] [11]优质平价的线上超市，天猫超市业务覆盖全国，并在多数城市实现了当日达和次日达。 [3]天猫超市通过甄选商品源，100%保证商品品质，提供更丰富和更本地化的商品供应；采用专业仓储物流，提供“半日达”、“次日达”等灵活配送服务；致力于满足广大消费者全场景生活需求。采用商品统一入仓、统一专业打包，追求一站购齐的便捷体验。天猫超市1次买齐送上门。'),(4,NULL,'costa','/profile/upload/2024/05/13/R7YW{N50]L))NMBQ9UY9S6Y_20240513172433A002.png','你猜在哪里 开业，招呼一桌！'),(5,1,'米奇妙妙屋',NULL,'我也不知道在哪 阿巴啊巴啊巴');
/*!40000 ALTER TABLE `store` ENABLE KEYS */;
UNLOCK TABLES;

